IF OBJECT_ID('dbo.proc_transform_61', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_61;
GO
CREATE PROCEDURE dbo.proc_transform_61
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_61
    SET payload = LEFT(payload, 1000) + N'|V4-61|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_61;
END
GO
IF OBJECT_ID('dbo.audit_v4_61', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.audit_v4_61 (aid INT IDENTITY(1,1) PRIMARY KEY, msg NVARCHAR(2000), created_on DATETIME2 DEFAULT SYSUTCDATETIME());
END
GO
EXEC dbo.proc_transform_61;
GO

CREATE INDEX IDX_staging_61_payload ON dbo.staging_table_61 (id);
GO
